
pc.script.createLoadingScreen(function (app) {
    var showSplash = function () {
        // splash wrapper
        var wrapper = document.createElement('div');
        wrapper.id = 'application-splash-wrapper';
        //wrapper.style.backgroundImage = 'url("data:image/png;base64,")';
        wrapper.style.backgroundImage = 'url("data:image/jpeg;base64,")';
        wrapper.style.backgroundRepeat = 'repeat';
        wrapper.style.backgroundSize = '100% 100%';
        document.body.appendChild(wrapper);

        var logo = document.createElement('div');
        logo.style.backgroundImage = 'url("data:image/png;base64,")';
        wrapper.appendChild(logo);
        logo.id = "logo";
        //logo.onload = function () {splash.style.display = 'block';};
         
        var container = document.createElement('div');
        container.id = 'progress-bar-container';
        wrapper.appendChild(container);

        var bar = document.createElement('div');
        bar.id = 'progress-bar';
        bar.style.backgroundImage = 'url("data:image/png;base64,")';
        container.appendChild(bar);
 
    };

    var hideSplash = function () {
        var splash = document.getElementById('application-splash-wrapper');
        splash.parentElement.removeChild(splash);
    };

    var setProgress = function (value) {
        var bar = document.getElementById('progress-bar');
        if(bar) {
            value = Math.min(1, Math.max(0, value));
            bar.style.width = value * 100 + '%';
        }
    };

    var createCss = function () {
        var css = [
            'html, body {position:fixed !important; overflow:hidden !important;}',
            
            'body {',
            '    background-color: #0e2839;',
            '}',

            '#application-splash-wrapper {',
            '    position: absolute;',
            '    top: 0;',
            '    left: 0;',
            '    height: 100%;',
            '    width: 100%;',
            '    margin: 0 auto;',
            '    background-color: #0e2839;',
            '    background-size: cover;',
            '    background-repeat: no-repeat;',
            '    background-position: center center;',
            '    z-index: 100000000000000;',
            '}',

            '#application-splash {',
            '    position: absolute;',
            '    top: 0%;',
            '    width: 572px;',
            '    left: calc(50% - 286px);',
            '    text-align: center;',            
            '}',
                
            '#logo {',
            '    position: relative;',
            '    left: 25%;',
            '    top: 0%;',
            '    width: 50%;',
            '    height: 90%;',
            '    background-size: contain;',
            '    background-repeat: no-repeat;',
            '    background-position: top center;',
            '}',
            
            '#progress-bar-container {',
            '    position: absolute;',
            '    top: 75%;',
            '    height: 50px;',
            '    width: 628px;',
            '    left: calc(50% - 314px);',
            //'    margin: 0 auto;',
            '    padding: 5px;',
            '    background: #52355B;',
            '    border-radius: 25px;',
            '    box-sizing: border-box;',
            '}',

            '#progress-bar {',
            '    width: 0%;',
            '    height: 100%;',
            '    background-color: #f2d827;',
            '    background-repeat: no-repeat;',
            '    border-radius: 25px;',
            //'    border-top: 2px solid #ffee2d;',
            //'    border-right: 2px solid #ffee2d;',
            //'    border-left: 2px solid #ffee2d;',
            '}',
            
            '#mobileButton {',
            '    display: none;',
            '    margin: 30px auto 0;',
            '}',
            /*
            '@media all and (max-width: 980px) and (orientation:landscape) {',
            '    #application-splash {top:0%; transform:scale(0.5);}',
            '}',*/
            
        ].join("\n");

        var style = document.createElement('style');
        style.type = 'text/css';
        if (style.styleSheet) {
          style.styleSheet.cssText = css;
        } else {
          style.appendChild(document.createTextNode(css));
        }

        document.head.appendChild(style);
    };

    createCss();
    showSplash();
        
    app.on('preload:end', function () {
        app.off('preload:progress');
    });
    app.on('preload:progress', setProgress);
    app.on('start', function() {
        hideSplash();
    });
});